import React, { useState } from "react";
import {
  Container,
  TextField,
  Button,
  Typography,
  Paper,
  Box,
  InputAdornment,
} from "@mui/material";
import { motion } from "framer-motion";
import EmailIcon from "@mui/icons-material/Email";
import LockIcon from "@mui/icons-material/Lock";
import PhoneIphoneIcon from "@mui/icons-material/PhoneIphone";
import {LogInData} from './data'

export default function LoginPage() {
  const [form, setForm] = useState({ email: "", phone: "", password: "" });
  const [errors, setErrors] = useState({});

  const handleChange = (field) => (e) => {
    setForm({ ...form, [field]: e.target.value });
  };

  const validate = () => {
    const errs = {};
    if (!form.email.includes("@")) errs.email = "Enter a valid email.";
    if (!/^\+?[0-9]{10,15}$/.test(form.phone)) errs.phone = "Enter a valid WhatsApp number.";
    if (!form.password.trim()) errs.password = "Password is required.";
    if(form.password.length < 8) {
        errs.password = 'Password must be atleast 8 characters'
    }else {}
    setErrors(errs);
    return Object.keys(errs).length === 0;
  };

  const handleSubmit = (e) => {
    if (validate()) {
      alert("Logged in successfully!");
      // navigate to app dashboard or tasks page
    }
    if ( LogInData.email, LogInData.number, LogInData.password ==={ ...form}){
      return true
    }else {
      alert('wrong phone numeber, email or password')
      e.preventDefault()
        }
  };

  return (
    <Container maxWidth="sm" sx={{ py: 8 }}>
      <Paper elevation={4} sx={{ p: 4, position: "relative", overflow: "hidden" }}>
        <motion.div
          initial={{ opacity: 0, scale: 0.8 }}
          animate={{ opacity: 1, scale: 1 }}
          transition={{ duration: 0.6 }}
        >
          <Typography variant="h4" align="center" gutterBottom>
            Welcome Back ðŸ‘‹
          </Typography>
          <Typography variant="body1" align="center" sx={{ mb: 3 }}>
            Sign in to stay focused
          </Typography>
          <Box display="flex" flexDirection="column" gap={2}>
            <TextField
              label="Email"
              value={form.email}
              onChange={handleChange("email")}
              error={!!errors.email}
              helperText={errors.email}
              InputProps={{
                startAdornment: (
                  <InputAdornment position="start">
                    <EmailIcon />
                  </InputAdornment>
                ),
              }}
              fullWidth
            />
            <TextField
              label="WhatsApp Number"
              value={form.phone}
              onChange={handleChange("phone")}
              error={!!errors.phone}
              helperText={errors.phone}
              placeholder="e.g. +1234567890"
              InputProps={{
                startAdornment: (
                  <InputAdornment position="start">
                    <PhoneIphoneIcon />
                  </InputAdornment>
                ),
              }}
              fullWidth
            />
            <TextField
              label="Password"
              type="password"
              value={form.password}
              onChange={handleChange("password")}
              error={!!errors.password}
              helperText={errors.password}
              InputProps={{
                startAdornment: (
                  <InputAdornment position="start">
                    <LockIcon />
                  </InputAdornment>
                ),
              }}
              fullWidth
            />
            <Button variant="contained" onClick={handleSubmit} size="large">
              Login
            </Button>
          </Box>
        </motion.div>
        {/* SVG Animated Background */}
        <motion.svg
          xmlns="http://www.w3.org/2000/svg"
          viewBox="0 0 1440 320"
          style={{ position: "absolute", bottom: 0, left: 0, width: "100%", opacity: 0.1 }}
          initial={{ y: 100 }}
          animate={{ y: 0 }}
          transition={{ duration: 2, ease: "easeOut" }}
        >
          <path
            fill="#1976d2"
            d="M0,224L48,202.7C96,181,192,139,288,138.7C384,139,480,181,576,181.3C672,181,768,139,864,112C960,85,1056,75,1152,101.3C1248,128,1344,192,1392,224L1440,256V320H0Z"
          ></path>
        </motion.svg>
      </Paper>
{console.log(LogInData)}
    </Container>
  );
}
